import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

import uxImage from '../img/section/UX.png';
import reactJsImage from '../img/section/reactjs.jpeg';
import machineLearningImage from '../img/section/machine.jpeg';
import centerImage from '../img/section/center.png';

const CoursesSlider = () => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
        autoplay: true,
        autoplaySpeed: 3000,
    };

    return (
        <div className="courses-slider">
            <Slider {...settings}>
                {/* First Slide */}
                <div className="slide">
                    <div className="slide-content">
                        <div className="image-overlay">
                            <img src={uxImage} alt="UI/UX Design" />
                        </div>
                        <div className="slide-text">
                            <h3>UI/UX Design</h3>
                            <p className="free">FREE</p>
                            <p>Unlock the secrets of exceptional user experiences with our UI/UX design training program. Dive into the fundamentals of user interface (UI) and user experience (UX) design to create intuitive, visually appealing digital products.</p>
                            <div className="center-info">
                                <img src={centerImage} height="20px" alt="Proservices Training Company" />
                                <h4>Proservices Training Company</h4>
                            </div>
                            <div className="course-info">
                                <ul>
                                    <li>.6-8 week course</li>
                                    <li>.Certified</li>
                                </ul>
                            </div>
                            <a href="#" className="discover">Enroll now</a>
                        </div>
                    </div>
                </div>

                {/* Second Slide */}
                <div className="slide">
                    <div className="slide-content">
                        <div className="image-overlay">
                            <img src={reactJsImage} alt="React" />
                        </div>
                        <div className="slide-text">
                            {/* Fill in the content for the second slide */}
                        </div>
                    </div>
                </div>

                {/* Third Slide */}
                <div className="slide">
                    <div className="slide-content">
                        <div className="image-overlay">
                            <img src={machineLearningImage} alt="Machine Learning" />
                        </div>
                        <div className="slide-text">
                            {/* Fill in the content for the third slide */}
                        </div>
                    </div>
                </div>

                {/* Add more slides here */}
            </Slider>
        </div>
    );
}

export default CoursesSlider;
